import React from "react";
import "../css/home.css";

const Home = () => {
  return (
    <div className="flexContainer">
      <form className="form" action="">
        <input className="userInput" type="text" />
        <button className="buttonInput">Search</button>
      </form>
    </div>
  );
};

export default Home;
